Short Trip with Big Memories

Kali ini kami liburan singkat aja nih gak jauh-jauh dari Jakarta, yang penting bisa quality time sama keluarga dan menjauh sejenak dari rutinitas ngantor yang menguras energy ya kannn.

Untuk akomodasi kami pilih di Royal Tulip Gunung Geulis Hotel karena udah jadi favorite keluarga banget deh, banyak kids activity yang pastinya bikin Aga selalu betah dan pingin balik lagi kesini, senyaman itu asli. 

Kami juga cobain makan di Coger Kujang Bogor, tempatnya asik lho buat ngumpul bareng temen atau keluarga, ada kids meal gitu disini btw. 

Lanjut kami jalan-jalan ke Taman Safari nih pastinya jadi  destinasi favorit banyak keluarga juga di musim liburan seperti ini.

Gak lupa mampir juga nih ke Kopinako Kebonjati yang kebetulan Cuma 5 menit aja dari Hotel, mountain view nya cakep banget, sayangnya 2x kesini siang malam sama-sama ruamee bet, huhu. 

